import React from 'react';
import './style.css';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import { Link } from 'react-router-dom';

const AlertaSesion = (props) => {
    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered
            className='fondoAlertaSesion'
            
        >
            <Modal.Header closeButton className='bg-transparent' style={{backgroundColor: '#FFDEE9',
                backgroundImage: 'linear-gradient(0deg, #FFDEE9 0%, #B5FFFC 100%)'
                }}>
                <Modal.Title id="contained-modal-title-vcenter">
                   {props.title}
                </Modal.Title>
            </Modal.Header>
            <Modal.Body style={{backgroundColor: '#FFDEE9',
                backgroundImage: 'linear-gradient(0deg, #FFDEE9 0%, #B5FFFC 100%)'
                }}>
                <Link                 className="text-decoration-none text-center h1 text-primary"
 to="/registro">Crearme una cuenta</Link>
<br />
<h4>o</h4>
               
               <Link className="text-decoration-none text-center h3 text-secondary" to="/login">Iniciar sesi√≥n</Link>
            </Modal.Body>
            <Modal.Footer style={{backgroundColor: '#FFDEE9',
                backgroundImage: 'linear-gradient(0deg, #FFDEE9 0%, #B5FFFC 100%)'
                }}>
                <Button onClick={props.onHide} className='btn-danger'>Close</Button>
            </Modal.Footer>
        </Modal>
    );
}

export default AlertaSesion;
